import ReturnActif from './Actif';
import HashLoader from 'react-spinners/HashLoader';

// Return Actif
export default function ActiF() {

 const [loading, setLoading] = React.useState(false);
 React.useEffect(() => {

  setLoading(true);
  setTimeout(() => {
   setLoading(false);
  }, 3600);

 }, []);



 return (

  <div>
   {
    loading ?
     <div className='App-loading'>
      <HashLoader
       size={80}
       color={'#123abc'}
       loading={loading}
      />
     </div>
     :
     <ReturnActif />
   };
  </div>

 );
};
